B.KF=A.a(s(["Sit with 3 beers between your legs, placed in a triangle shape, facing opponent ( pointing towards him )","Open the beers and put the capsules upside down so that they are in an equilibrium state over the beers","The distance between your first beer and his first beer must be 1m and 92cm","You randomly choose who begins","You have to hit opponent capsules with additional capsules, 1 shot at a time","You are allowed to play with plain capsules (plates) or to fold them (pli\xe9es)","When you hit one capsule or several, the opponent can try to save","If he hits you back with the same number or more capsules than you hit him with, it's your turn to try  to save, etc...","If he doesn't save he has to drink 1/3 of the beer(s) that was(were) hit","If a player is hit for 3 and saves 1, he only drinks 2, if he saves 2, he only drinks 1,...","Each beer has 3 lives, so that makes it 9 lives total per player","When one beer is empty, it's out of the game, you have to place the 2 remaining beers at the base of what was previously a triangle","When another beer is empty, you have to center the remaining beer","When the capsule bounces before the beers triangle (ex. : on your legs or on the ground ) and hit the beers capsules, it counts as a hit","When the capsule bounces after the beers triangle (ex. : on your belly ) and hit the beers capsules, it doesn't count as a hit","When you touch your capsules by mistake, you can replace them back, as well as if they are displaced","Main de dieu :\n When the capsule bounces anywhere and goes back to the player that shot it, he can grab it and play it again(even if he had shot a beer with it),  with the hand he grabbed it with, only if he doesn't have to lift ass cheeks to grab it (it's in arms range)","Caps en argent : Each player has 2 lives remaining","Caps en or : Each player has 1 life remaining","Droit de pisse : Each team can go to the bathroom once in a game","It is forbidden to block the opponent shots at any time and might get you banned if you proceed likeso","2vs2 : you are allowed to shoot any opponent","2vs2 : In 2vs2 the capsules hits are shared: for exemple if you are shot 1 time and your teamate 2 times, you must save 3 sips or more as a team","2vs2 : If you don't save enough, you choose as a team how you will distribute sips among the team according to the beers that have been shot","2vs2 : Zombie \n When a player dies, he does not shoot anymore, his partner is alone, until his partner is under fire, then he is allowed  to shoot to try to save him"]),t.s)
